import './Contact.css';
import location from "../images/location.png";
import mail from "../images/mail.png";
import call from "../images/call.png";

function Contact() {
    return(
      <section className='contactUs'>
        <div class="contact">
        <div class="contactInfo">
          <div>
            <h2>Contact Info</h2>
          </div>
          <div class="ContactForm">

        </div>
        </div>
      </div>
      </section>
    );
}

export default Contact;
